/* (Author: Tytrez Dixon; Date: 1/26/2025) This .tsx file contains 
   the necessary function and imports to display a single vehicle entry 
   for the information system. This component includes an image of the vehicle, 
   basic information, and a "View Details" button.

   NOTE: THIS FILE WILL BE MODIFIED LATER TO ACCOMMODATE THE VEHICLE DATABASE!
*/

/* Import the necessary functions and files. */
import React from 'react';
import '../styles/WebApp.css';

/* This function returns the content for a single vehicle entry. */
function VehicleEntry() {
    return (
        <div className="vehicle-entry-container">
            {/* Image of the vehicle. */}
            <img
                className="vehicle-image"
                src="https://www.carscoops.com/wp-content/uploads/webp/2022/12/2022-Jaguar-XE.webp"
                alt="Vehicle"
                width={250}
                height={250}
            />

            {/* General information about the vehicle. */}
            <div className="vehicle-info">
                {/* NOTE: THIS SECTION WILL BE UPDATED TO DISPLAY ACTUAL INFO FROM THE DATABASE! */}
                <p>[General Info]</p>
            </div>

            {/* "View Details" button to navigate to the detailed vehicle page. */}
            <button className="view-details-button">
                View Details
            </button>
        </div>
    );
}

export { VehicleEntry };
